import React from 'react';
import './ServicesPage.css';

const ServicesPage = () => {
  const services = [
    {
      icon: 'fas fa-code',
      title: 'Fullstack AI Development',
      description: 'Custom AI app and platform development from end-to-end. We integrate GenAI into existing business systems with scalable deployment, focusing on performance, cost, and security.',
      features: [
        'Custom AI Applications',
        'System Integration', 
        'Scalable Deployment',
        'Performance Optimization',
        'Security Implementation',
        'API Development'
      ]
    },
    {
      icon: 'fas fa-lightbulb',
      title: 'GenAI Consulting',
      description: 'We identify and prioritize AI use cases tailored to your industry, build strategy roadmaps for adoption, and help you go from idea to working prototype.',
      features: [
        'Use Case Identification',
        'Strategy Roadmaps',
        'Prototype Development',
        'Tool Selection',
        'Implementation Planning',
        'ROI Analysis'
      ]
    },
    {
      icon: 'fas fa-graduation-cap',
      title: 'Workforce Education & Training',
      description: 'Workshops and training programs to upskill teams in GenAI tools. Hands-on sessions for developers, business leaders, and non-technical staff.',
      features: [
        'Team Workshops',
        'Hands-on Training',
        'Practical Use Cases',
        'Custom Curricula',
        'Certification Programs',
        'Ongoing Support'
      ]
    },
    {
      icon: 'fas fa-sitemap',
      title: 'AI Strategy & Architecture',
      description: 'Comprehensive AI strategy development and system architecture design to ensure your AI initiatives align with business objectives.',
      features: [
        'Strategic Planning',
        'Architecture Design',
        'Technology Assessment',
        'Risk Management',
        'Governance Framework',
        'Scalability Planning'
      ]
    },
    {
      icon: 'fas fa-chart-line',
      title: 'Data Analytics & Insights',
      description: 'Transform your data into actionable insights with advanced analytics, machine learning models, and interactive dashboards.',
      features: [
        'Data Pipeline Development',
        'ML Model Development',
        'Interactive Dashboards',
        'Predictive Analytics',
        'Data Visualization',
        'Performance Monitoring'
      ]
    },
    {
      icon: 'fas fa-robot',
      title: 'AI Process Automation',
      description: 'Streamline business processes with intelligent automation solutions that reduce manual work and improve efficiency.',
      features: [
        'Process Analysis',
        'Workflow Automation',
        'Document Processing',
        'Intelligent Routing',
        'Quality Assurance',
        'Performance Tracking'
      ]
    }
  ];

  return (
    <div className="services-page" style={{
      background: '#0f1419',
      minHeight: '100vh',
      color: '#ffffff'
    }}>
      {/* Debug Banner */}
      <div style={{
        background: 'red',
        color: 'white',
        padding: '1rem',
        textAlign: 'center',
        fontSize: '1.5rem',
        fontWeight: 'bold'
      }}>
        ðŸš¨ SERVICES PAGE IS WORKING! ðŸš¨
      </div>

      {/* Hero Section */}
      <section className="services-hero" style={{
        padding: '4rem 0',
        textAlign: 'center'
      }}>
        <div className="container" style={{
          maxWidth: '1200px',
          margin: '0 auto',
          padding: '0 2rem'
        }}>
          <div className="hero-content">
            <h1 style={{
              fontSize: '3.5rem',
              fontWeight: '700',
              marginBottom: '1.5rem',
              color: '#ffffff'
            }}>Our Services</h1>
            <p style={{
              fontSize: '1.25rem',
              color: '#e2e8f0',
              maxWidth: '600px',
              margin: '0 auto'
            }}>Professional GenAI solutions to accelerate your business transformation</p>
          </div>
        </div>
      </section>

      {/* Services Grid */}
      <section className="services-content" style={{ padding: '4rem 0' }}>
        <div className="container" style={{ maxWidth: '1200px', margin: '0 auto', padding: '0 2rem' }}>
          <div style={{
            background: 'yellow',
            color: 'black',
            padding: '1rem',
            marginBottom: '2rem',
            textAlign: 'center',
            fontWeight: 'bold'
          }}>
            DEBUG: Services Array Length: {services.length}
          </div>
          <div className="services-grid" style={{
            display: 'grid',
            gridTemplateColumns: 'repeat(auto-fit, minmax(400px, 1fr))',
            gap: '2rem'
          }}>
            {services.map((service, index) => (
              <div key={index} style={{
                background: '#1e293b',
                border: '1px solid #475569',
                borderRadius: '15px',
                padding: '2rem',
                color: '#ffffff'
              }}>
                <div style={{ display: 'flex', alignItems: 'center', marginBottom: '1.5rem' }}>
                  <div style={{
                    width: '60px',
                    height: '60px',
                    background: 'linear-gradient(135deg, #00d4aa, #0ea5e9)',
                    borderRadius: '12px',
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'center',
                    marginRight: '1rem'
                  }}>
                    <i className={service.icon} style={{ fontSize: '1.5rem', color: 'white' }}></i>
                  </div>
                  <h3 style={{ 
                    fontSize: '1.5rem', 
                    fontWeight: '600', 
                    color: '#ffffff',
                    margin: '0'
                  }}>{service.title}</h3>
                </div>

                <p style={{
                  color: '#e2e8f0',
                  fontSize: '1rem',
                  lineHeight: '1.6',
                  marginBottom: '1.5rem'
                }}>{service.description}</p>

                <div style={{ marginBottom: '2rem' }}>
                  <h4 style={{
                    color: '#00d4aa',
                    fontSize: '1.1rem',
                    fontWeight: '600',
                    marginBottom: '1rem'
                  }}>What We Deliver:</h4>
                  <ul style={{
                    listStyle: 'none',
                    padding: '0',
                    margin: '0'
                  }}>
                    {service.features.map((feature, featureIndex) => (
                      <li key={featureIndex} style={{
                        color: '#e2e8f0',
                        padding: '0.4rem 0',
                        paddingLeft: '1.5rem',
                        position: 'relative',
                        fontSize: '0.95rem'
                      }}>
                        <span style={{
                          position: 'absolute',
                          left: '0',
                          color: '#00d4aa',
                          fontWeight: 'bold'
                        }}>âœ“</span>
                        {feature}
                      </li>
                    ))}
                  </ul>
                </div>

                <div>
                  <a href="/#contact" style={{
                    display: 'inline-block',
                    padding: '0.75rem 1.5rem',
                    background: 'transparent',
                    color: '#00d4aa',
                    border: '2px solid #00d4aa',
                    borderRadius: '8px',
                    textDecoration: 'none',
                    fontWeight: '600',
                    fontSize: '0.95rem',
                    transition: 'all 0.3s ease'
                  }}>
                    Get Started
                  </a>
                </div>
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* CTA Section */}
      <section className="services-cta">
        <div className="container">
          <div className="cta-content">
            <h2>Ready to Transform Your Business with AI?</h2>
            <p>Let's discuss how GenAI can accelerate your growth and streamline operations.</p>
            <button className="btn btn-primary" onClick={() => {
              window.location.href = '/#contact';
            }}>
              Schedule Free AI Consultation
            </button>
          </div>
        </div>
      </section>
    </div>
  );
};

export default ServicesPage;
